import Styled from "styled-components";
const Title = Styled.h1`
  font-size: 1.5em;
  text-align: center;
  color: rgb(32, 255, 88);
  padding: 4em;
  background: Black;
`
export default function Header(){
    return (
        <Title>
            <h1>How To??</h1>
        </Title>
    );
};
